import React from "react";

import "./SettingsMenu.scss";
import whiteCross from "../../assets/images/white-cross.png";
import profilePicture from "../../assets/images/profile-picture.png";

const SettingsMenu = props => {
  const { userName, toggleSettings } = props;
  return (
    <div className="settings-menu">
      <div className="settings-menu__content">
        <img src={whiteCross} alt="Close menu" className="settings-menu__cross" 
        onClick={toggleSettings}/>
        <img src={profilePicture} alt="setting menu" className="settings-menu__profile" />
        <input type ="text" className="settings-menu__title--firstname" />
        <input type ="text" className="settings-menu__title--lastname" />
      </div>
    </div>
  );
};

export default SettingsMenu;

